import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import WalletConnectionProvider from './WalletConnectionProvider';

ReactDOM.render(
    <React.StrictMode>
        <WalletConnectionProvider>
            <App />
        </WalletConnectionProvider>
    </React.StrictMode>,
    document.getElementById('root')
);
